import React from "react";

function AppointmentCard({
  tutor_first_name,
  tutor_last_name,
  date,
  time,
  subject,
}) {
  return (
    <div className="md:flex bg-white shadow text-gray-800 my-4 py-4 px-10 rounded-md items-center justify-between hover:bg-gray-300">
      <p className="font text-md" style={{ color: "black", textAlign: "center" }}>
        {tutor_first_name}
      </p>
      <p className="font text-md" style={{ color: "black", textAlign: "center" }}>
        {tutor_last_name}
      </p>
      <p style={{ color: "black", textAlign: "center" }}>{date}</p>
      <p style={{ color: "black", textAlign: "center" }}>{time}</p>
      <p style={{ color: "black", textAlign: "center" }}>{subject}</p>
    </div>
  );
}

export default AppointmentCard;
